package main

// Return list of all prefixes from shortest to longest of the input string
// >>> AllPrefixes('abc')
// ['a', 'ab', 'abc']
func AllPrefixes(str string) []string {
	var prefixes []string
	// Iterate from 1 up to the length of the string to capture all prefixes
	// str[0:i] will give prefixes of length i
	for i := 1; i <= len(str); i++ {
		prefixes = append(prefixes, str[0:i])
	}
	return prefixes
}
